import React, { useEffect, useState } from "react";
import axios from "axios";

export default function AdminDashboard() {
  const [partenaires, setPartenaires] = useState([]);
  const [error, setError] = useState("");

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/admin/partners-with-employees")
      .then((res) => setPartenaires(res.data))
      .catch((err) => {
        console.error("❌ Erreur chargement partenaires :", err);
        setError("Erreur de chargement");
      });
  }, []);

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <h1 className="text-3xl font-bold text-[#003865] mb-6">Tableau de bord Administrateur</h1>
      
      {error && <p className="text-red-600 mb-4">{error}</p>}

      <div className="overflow-x-auto">
        <table className="min-w-full border border-gray-300 bg-white shadow">
          <thead className="bg-[#003865] text-white">
            <tr>
              <th className="p-3 border">Entreprise</th>
              <th className="p-3 border">Responsable</th>
              <th className="p-3 border">Adresse</th>
              <th className="p-3 border">Email</th>
              <th className="p-3 border">Téléphone</th>
              <th className="p-3 border">Nombre d’employés</th>
            </tr>
          </thead>
          <tbody>
            {partenaires.length > 0 ? (
              partenaires.map((p, index) => (
                <tr key={index} className="text-center">
                  <td className="p-2 border">{p.entreprise}</td>
                  <td className="p-2 border">{p.responsable}</td>
                  <td className="p-2 border">{p.adresse}</td>
                  <td className="p-2 border">{p.email}</td>
                  <td className="p-2 border">{p.phone}</td>
                  <td className="p-2 border font-bold text-blue-600">{p.nombreEmployes}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="6" className="p-4 text-center text-gray-500">
                  Aucun partenaire enregistré
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}
